import React from "react";

const Projectshow = () => {
  return (
    <div>
      <h1>Projects</h1>
      <div className="box">
        <br />
        <h2>Projects</h2>
        <br />
        <div className="box2">
          <input type={"text"} placeholder="enter project name" className="bold"/>
          <button className="button">save</button>
          <br />
          <br />
          <hr />
        </div>
      </div>
    </div>
  );
};

export default Projectshow;
